Read important information about [caring for yourself](https://www.cdc.gov/coronavirus/2019-ncov/if-you-are-sick/steps-when-sick.html) or [someone else who is sick](https://www.cdc.gov/coronavirus/2019-ncov/if-you-are-sick/care-for-someone.html) and follow these steps to help [protect others from getting sick](https://www.cdc.gov/coronavirus/2019-ncov/if-you-are-sick/steps-when-sick.html).`,



  msg9: `**Stay home and take care of yourself. Call a medical provider within 24 hours.**

