Learn more about COVID-19 and steps you can take to protect yourself and others on the [CDC website](https://www.cdc.gov/coronavirus/2019-ncov/prevent-getting-sick/index.html).`,



  msg16: `**Monitor for symptoms.**

Watch for [COVID-19 symptoms](https://www.cdc.gov/coronavirus/2019-ncov/symptoms-testing/symptoms.html). If you develop symptoms, call your healthcare provider, clinician advice line, or telemedicine provider. 
Learn more about COVID-19 and steps you can take to protect yourself and others on the [CDC website](https://www.cdc.gov/coronavirus/2019-ncov/prevent-getting-sick/index.html).`,


  msg17: `**Monitor for symptoms, wear a mask.**

Watch for [COVID-19 symptoms](https://www.cdc.gov/coronavirus/2019-ncov/symptoms-testing/symptoms.html). If you develop symptoms, call your occupational health provider as well as your healthcare provider, clinician advice line, or telemedicine provider. Since you work or volunteer in a healthcare facility, you may be asked to wear a mask to protect yourself and those around you.`,



  msg18: `**Monitor for symptoms, stay at home.**

